INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, 2, 190803, 64, "2030/01/01 14:59:59", 1000007, 2.33, 7, 1, "カリン", "2025/01/31 12:00:00", -363.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, 3, 133701, 61, "2030/01/01 14:59:59", 1020101, 5.18, 101, 10201, "ラビリスタ", "2025/01/31 12:00:00", -285.0, -6.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2, 1, 133901, 61, "2030/01/01 14:59:59", 1020102, 8.77, 201, 10201, "クリスティーナ", "2025/01/31 12:00:00", -285.0, -2.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1, 6, 133801, 61, "2030/01/01 14:59:59", 1020103, 15.5, 301, 10201, "ネネカ", "2025/01/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 5, 2, 134301, 61, "2030/01/01 14:59:59", 1020201, 9.061, 101, 10202, "ランファ", "2025/02/28 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 2, 1, 134401, 61, "2030/01/01 14:59:59", 1020202, 7.699, 201, 10202, "チカ", "2025/02/28 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 2, 1, 134601, 61, "2030/01/01 14:59:59", 1020301, 8.595, 101, 10203, "アオイ", "2025/03/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 2, 1, 134501, 61, "2030/01/01 14:59:59", 1020302, 7.758, 201, 10203, "クローチェ", "2025/03/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 6, 2, 132302, 61, "2030/01/01 14:59:59", 1020401, 7.0, 101, 10204, "ルイズマリー", "2025/04/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 2, 1, 132402, 61, "2030/01/01 14:59:59", 1020402, 7.904, 201, 10204, "イロハ", "2025/04/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 2, 4, 132502, 61, "2030/01/01 14:59:59", 1020403, 8.487, 301, 10204, "ソノ", "2025/04/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 2, 1, 134901, 61, "2030/01/01 14:59:59", 1020502, 8.763, 101, 10205, "カノン", "2025/05/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 3, 1, 134801, 61, "2030/01/01 14:59:59", 1020503, 6.417, 201, 10205, "ツムギ", "2025/05/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 7, 3, 135001, 61, "2030/01/01 14:59:59", 1020601, 10.335, 101, 10206, "エリス", "2025/06/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 4, 2, 135101, 61, "2030/01/01 14:59:59", 1020602, 6.281, 201, 10206, "シェフィ", "2025/06/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 2, 1, 135201, 61, "2030/01/01 14:59:59", 1020603, 12.244, 301, 10206, "プレシア", "2025/06/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 8, 2, 135301, 61, "2030/01/01 14:59:59", 1020701, 6.339, 101, 10207, "クリア", "2025/07/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 9, 7, 135401, 61, "2030/01/01 14:59:59", 1020702, 8.184, 201, 10207, "アネモネ", "2025/07/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 2, 9, 129101, 61, "2030/01/01 14:59:59", 1020801, 3.906, 101, 10208, "アイラ", "2025/08/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 2, 1, 129201, 61, "2030/01/01 14:59:59", 1020802, 14.465, 201, 10208, "シナツ", "2025/08/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 3, 4, 100101, 61, "2030/01/01 14:59:59", 1020803, 8.662, 301, 10208, "ヒヨリ", "2025/08/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 3, 1, 100301, 61, "2030/01/01 14:59:59", 1020804, 10.915, 401, 10208, "レイ", "2025/08/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 7, 1, 135802, 61, "2030/01/01 14:59:59", 1020901, 6.042, 101, 10209, "ユキノ", "2025/09/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 1, 4, 135903, 61, "2030/01/01 14:59:59", 1020902, 9.402, 201, 10209, "サツキ", "2025/09/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 1, 8, 136902, 61, "2030/01/01 14:59:59", 1020903, 8.16, 301, 10209, "ルルィ", "2025/09/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 2, 3, 137401, 61, "2030/01/01 14:59:59", 1021001, 5.0, 101, 10210, "カスミ", "2025/10/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 1, 4, 136001, 61, "2030/01/01 14:59:59", 1021002, 8.12, 201, 10210, "アラクネ", "2025/10/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 2, 4, 136202, 61, "2030/01/01 14:59:59", 1021003, 6.386, 301, 10210, "ナーナ", "2025/10/31 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 4, 3, 136402, 61, "2030/01/01 14:59:59", 1021101, 7.438, 101, 10211, "ユイ", "2025/11/30 12:00:00", -285.0, 0.0);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 5, 1, 136302, 61, "2030/01/01 14:59:59", 1021102, 8.35, 201, 10211, "ミソラ", "2025/11/30 12:00:00", -285.0, 0.0);
